  input: '"TEXT","F3A","C00313510","We are filing this amendment in response to a
    letter we received from Anne Marie Brady dated June 4, 2002. We refer to our april
    2002 quarterly report to answer your questions regarding Albetta, Benevento, Carella,
    Cohen-Fenster, Creamer, Ciongoli, Daloisio, Feinstein, Galluccio, Gensinger,  Klein,
    Kraft, Luke, Marino, McPherson, Medina, Milano, Panepinto, Parisi, Roe, Rudnick,
    Sanzari and Sekula. Marcalus should be answered by this report. The partnership
    contrib of Gerber & Samson was originally attributed to the wrong partner and
    is now properly attributed to Gallagher. There were 4 redesignations that were
    returned late and 3 that were never returned and so those contribtions totaling
    $4,100 are being returned. Copies of those returned checks are being provided
    to Ms. Brady forthwith. Please let us know if you have any other questions or
    need any furhter information and we will do our best to furnish same. Thank you."'
